import React from "react";

interface Props {
    dates: string[],
    titles: string[],
    descriptors: string[][]
}


// Put arrow on selected tab =)
class Awards extends React.PureComponent<Props>{
    rendered_page_index = 0;

    openProject = (id: number) => {
        this.rendered_page_index = id;
        this.forceUpdate();
    }

    render() {
        const { dates, titles, descriptors } = this.props;
        const awards = [];
        for (let i = 0; i < titles.length; i++) {
            awards.push(
                <div className="textAlternator">
                    <p>
                        <strong><i>{dates[i]}: {titles[i]}</i></strong><br /><br />
                        {descriptors[i]}
                    </p>
                </div>
            )
        }

        return (
            <section id="accolades">
                <h1>Pretty medals!</h1>
                {awards}
            </section>
        );
    }
}


export default Awards
